import React, { Component } from "react";
// import { Route } from 'react-router';
import './App.scss';
import { HashRouter, BrowserRouter as Router, Route } from "react-router-dom";

// import Home from "./Home";
// import About from "./About";
// import Overview from "./Overview";
// import Demo from "./Demo";
// import Contact from "./Contact";
// import Footer from "./Footer";
// import PrivacyPolicy from "./PrivacyPolicy";
import logo from './images/Logo/YMP small logo no bg.png';
import user from './images/Logo/user-solid.svg';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
    Container, Navbar, Nav, NavLink
} from 'react-bootstrap';
// import { SectionsContainer, Section } from 'react-fullpage';
import HomePage from "./HomePage";
import PrivacyPolicy from "./PrivacyPolicy";

class Main extends Component {

    render() {
        // if(window.screen.width < 900) {
        //     var scroll = true;
        // } else {
        //     scroll = false;
        // }

        // let options = {
        //     sectionClassName: 'section',
        //     anchors: ['home', 'about', 'overview', 'demo', 'contact', 'footer'],
        //     responsiveWidth: 900,
        //     scrollBar: scroll,
        //     navigation: true,
        //     verticalAlign: true,
        //     sectionPaddingTop: '95px',
        //     arrowNavigation: true,
        // };

        return (
            // <HashRouter>
             <Router>
                <div className="App-header">
                    <Navbar fixed="top" collapseOnSelect expand="lg" variant="dark" justify-content-between="true">
                        <Container>
                            <Navbar.Brand href="/homePage/#header">
                                <img src={logo} className="App-header-logo" alt="logo" />
                                <span className="App-header-text">yacht maintenance program</span>
                            </Navbar.Brand>

                            <Navbar.Toggle aria-controls="responsive-navbar-nav" />

                            <Navbar.Collapse id="responsive-navbar-nav" className="justify-content-end">
                                <Nav className="mr-auto mr-sm-2">
                                    <Nav.Link href="/homePage/#header">Home</Nav.Link>
                                    <Nav.Link href="/homePage/#about">About Us</Nav.Link>
                                    <Nav.Link href="/homePage/#overview">Overview</Nav.Link>
                                    <Nav.Link href="/homePage/#demo">Get A Demo</Nav.Link>
                                    <Nav.Link href="/homePage/#contact">Contact Us</Nav.Link>
                                        <NavLink href="/privacypolicy">Contact Us</NavLink>
                                    <Nav.Link className="singin" href="https://ymponline.com/">
                                        <img src={user} className="user-logo" alt="logo" />Signin
                                    </Nav.Link>
                                </Nav>
                            </Navbar.Collapse>
                        </Container>
                    </Navbar>
                </div>
                <div className="App-content">
                    {/* <HomePage/> */}
                        <Route exact path="/homePage" component={HomePage} />
                        <Route path="/privacypolicy" component={PrivacyPolicy} />
                </div>

            </Router>
            //  </HashRouter>
        );
    }
}

export default Main;
